DROP TABLE IF EXISTS `execution_issues_closure`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `execution_issues_closure`  AS  select `exec`.`EXECUTION_ID` AS `execution_id`,`issue`.`ISSUE_ID` AS `issue_id` from (`execution` `exec` join `issue` on((`exec`.`ISSUE_LIST_ID` = `issue`.`ISSUE_LIST_ID`))) union select `eesteps`.`EXECUTION_ID` AS `execution_id`,`issue`.`ISSUE_ID` AS `issue_id` from ((`execution_execution_steps` `eesteps` join `execution_step` `estep` on((`eesteps`.`EXECUTION_STEP_ID` = `estep`.`EXECUTION_STEP_ID`))) join `issue` on((`estep`.`ISSUE_LIST_ID` = `issue`.`ISSUE_LIST_ID`))) ;

