(170, '<p>Je remplis le formulaire et je clique sur &quot;Soumettre&quot;.</p>', '<p>Je suis redirig&eacute; vers lapage du challenge.</p> \n<p>Un nouvel onglet &quot;Mon &eacute;quipe&quot; a &eacute;t&eacute; ajout&eacute; o&ugrave; je peux g&eacute;rer mon &eacute;quipe.</p>', 1873),
