(177, '<p>Je clique sur le bouton &quot;Participer&quot;.</p>', '<p>Une fen&ecirc;tre apparait, o&ugrave; l\'on doit choisir entre les options :</p> \n<ul> \n <li>Rejoindre une &eacute;quipe</li> \n <li>Cr&eacute;er&nbsp;une &eacute;quipe</li> \n</ul>', 1880),
