('core-1.8.0-feat-2699-02', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-1.8.0.xml', '2018-07-23 11:12:07', 254, 'EXECUTED', '3:b836ac219073c8957e573d6c6604c6fe', 'Update Data, Delete Data (x2)', 'the CORE_GROUP squashtest.authz.tm.group.ProjectManager is deleted and the users belonging to that group are now \n		demoted to squashtest.authz.group.tm.User', NULL, '2.0.5'),
('core-1.8.0-feat-2699-03', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-1.8.0.xml', '2018-07-23 11:12:07', 255, 'EXECUTED', '3:d063dbd2d9a2665bfe67a7eec60b6144', 'Create Table', 'The table CORE_PARY_AUTHORITY stores personal authorities. As for TM 1.8.0 the users and teams now have blanket permissions \n			(aka authorities) for themselves, not only via core_group membership. However, a user will still belong to one of the CORE_G...', NULL, '2.0.5'),
('core-1.8.0-feat-2699-04', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-1.8.0.xml', '2018-07-23 11:12:07', 256, 'EXECUTED', '3:0d0108ea67847977c9497d64786bffe4', 'Custom SQL', 'we have now to set the role ROLE_TM_PROJECT_MANAGER to the corresponding users', NULL, '2.0.5'),
('core-feat-327', 'mpagnon', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/core/core.changelog-1.4.0.xml', '2018-07-23 11:11:48', 15, 'EXECUTED', '3:34782a78840d9958a93867752ac303e8', 'Custom SQL', 'Because admin was not active , need to make sure that all user active in auth_user are active in core_user', NULL, '2.0.5'),
('tm-0.14.0.01', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:48', 16, 'EXECUTED', '3:4e6c3f9dea5db7ce08cde70ffee4b555', 'Create Table, Create Index', 'This table maintains the mapping between an issue in Squash and an \n			issue in the remote bugtracker', NULL, '2.0.5'),
('tm-0.14.0.02', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:48', 17, 'EXECUTED', '3:4923e5c1de211cad8c0f4b3c771c81af', 'Create Table, Create Index', 'each Squash entity that may be attached to one or several bugs will be given an issue list. This table will maintain that list, an entry means that some entity refering to it have several.', NULL, '2.0.5'),
('tm-0.14.0.03', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:48', 18, 'EXECUTED', '3:cf1b8733816e62e4fd608d629a0db0a0', 'Create Table', 'This table will map one issue_list to (0,several) issues', NULL, '2.0.5'),
('tm-0.14.0.04', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 19, 'EXECUTED', '3:448ea3a7190e89f1a3d8f01f461f5af4', 'Create Table', 'Cette table contient le contenu d\'une pièce jointe, dont les meta infos sont stockees dans la \n			table ATTACHMENT. La relation entre les deux tables est 1-1', NULL, '2.0.5'),
('tm-0.14.0.05', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 20, 'EXECUTED', '3:c3a74f53f543266e9664ced59749936d', 'Create Table, Create Index', 'Cette table stockera les pieces jointes. La piece elle même est un blob stocke a part dans\n					la table ATTACHMENT_CONTENT. La relation entre les deux tables est 1-1', NULL, '2.0.5'),
('tm-0.14.0.06', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 21, 'EXECUTED', '3:91e399d585df7a01de44b11c56ccc4b4', 'Create Table', 'Cette table matérialise une liste d\'ATTACHMENT. Bien qu\'elle ne contienne que sa clé primaire, \n			sa raison d\'exister est, au niveau de l\'application, de fournir \'d\'un point de vue technique) \n			une entité indépendante des entités métier auquel on ra...', NULL, '2.0.5'),
('tm-0.14.0.07', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 22, 'EXECUTED', '3:5aafdf5b488ea626d85ef782959884d0', 'Create Table', 'Table d\'association entre un cas de test et ses pieces jointes', NULL, '2.0.5'),
('tm-0.14.0.08', 'ramoussou', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 23, 'EXECUTED', '3:10f6bb98e3ad8c7688581c2434dc5596', 'Create Table, Create Index', 'Table representant les projets englobants les libraries d\'entite que nous utilisons.', NULL, '2.0.5'),
('tm-0.14.0.09', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 24, 'EXECUTED', '3:6ca7c6625c398a565905e6de822b7398', 'Create Table, Create Index', 'Cette table gere les bibliotheques de cas de test. Une bibliotheque de cas de test peut contenir plusieurs \n		repertoires et/ou cas de test, ces deux entites etant regroupees sous l\'appellation generique d\'element de bibliotheque \n		de cas de test (tes...', NULL, '2.0.5'),
('tm-0.14.0.10', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 25, 'EXECUTED', '3:70c11ac27e2a6bb65143efee427cd28e', 'Create Table, Create Index', 'Cette table gere les bibliotheques d\'exigences. Une bibliotheque d\'exigences peut contenir plusieurs repertoires \n				et/ou exigences, ces deux entites etant regroupees sous l\'appellation generique d\'element de bibliotheque d\'exigences (requirement \n		...', NULL, '2.0.5'),
('tm-0.14.0.11', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 26, 'EXECUTED', '3:fd84d5da84499f830851aa8a825f8ff9', 'Create Table, Create Index', 'Cette table gere les bibliotheques de campagnes. Une bibliotheque \n		de campagnes peut contenir plusieurs repertoires et/ou campagnes, ces deux \n		entites etant regroupees sous l\'appellation generique d\'element de bibliotheque \n		de campagnes (campaign...', NULL, '2.0.5'),
('tm-0.14.0.12', 'ramoussou', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 27, 'EXECUTED', '3:2e779973c9bd4020fafd9645e240fb4b', 'Add Foreign Key Constraint (x3)', '', NULL, '2.0.5'),
('tm-0.14.0.13', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 28, 'EXECUTED', '3:77ff261548687bed7e3050fc610081cc', 'Create Table', 'Cette table represente un element (generique) faisant partie d\'une bibliotheque de cas de test. Cet element \n		generique peut representer soit un repertoire, soit un cas de test. Pour cette raison, que l\'utilisateur cree l\'un ou \n		l\'autre cette table ...', NULL, '2.0.5'),
('tm-0.14.0.14', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 29, 'EXECUTED', '3:a9d2e473eafcd420919c707d59260567', 'Create Table', 'Cette table represente un element (generique) faisant partie d\'une bibliotheque d\'exigences. Cet element \n				generique peut representer soit un repertoire, soit une exigence. Pour cette raison, que l\'utilisateur cree l\'un ou l\'autre \n				cette table s...', NULL, '2.0.5'),
('tm-0.14.0.15', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 30, 'EXECUTED', '3:dabf7a16ee4eea69980a88a02299a585', 'Create Table', 'Cette table represente un element (generique) faisant partie \n				d\'une bibliotheque de campagne. Cet element generique peut representer soit \n				un repertoire, soit une campagne. Pour cette raison, que l\'utilisateur cree \n				l\'un ou l\'autre cette ta...', NULL, '2.0.5'),
('tm-0.14.0.16', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 31, 'EXECUTED', '3:958c749a03fa027fdd348b7d4923fc52', 'Create Table, Create Index', 'Cette table gere les cas de test proprement dits. Une entree dans cette table indique que l\'element reference dans la table TEST_CASE_LIBRARY_NODE par la cle primaire (egalement cle etrangere) est de type cas de test.', NULL, '2.0.5'),
('tm-0.14.0.17', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-0.15.0.xml', '2018-07-23 11:11:49', 32, 'EXECUTED', '3:7ab96cee4052f3f5d3d3202a15b0f734', 'Create Table, Create Index', 'Cette table est rudimentaire. La cle primaire est simplement une cle etrangere vers la table TEST_CASE_LIBRARY_NODE (relation qualifiante). \n		Une entree dans cette table indique que l\'element indexe par cette cle est de type repertoire.', NULL, '2.0.5'),
