('tm-1.11.0.feature-3700-1', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-1.11.0.xml', '2018-07-23 11:12:12', 302, 'EXECUTED', '3:add390e7eec45f884a462042b1536218', 'Add Column', 'Items of a campaign test plan can now reference Datasets', NULL, '2.0.5'),
('tm-1.11.0.feature-3701-1', 'bsiri', '/var/lib/jenkins/jobs/build-squash-tm-distros/workspace/standalone/target/maven-shared-archive-resources/tm/tm.changelog-1.11.0.xml', '2018-07-23 11:12:12', 303, 'EXECUTED', '3:7dbee782206c249e6d9efd793924d7e0', 'Add Column', 'An execution now remembers which dataset was used (or not). That new column encodes three states : \n				\"\" -> no dataset used,\n				somelabel -> the label of the dataset used,\n				null -> the test case had no parameters anyway', NULL, '2.0.5'),
