(6816, '<p>Je suis redirig&eacute; vers la page d&#39;accueil et je verifier&nbsp;le nom de l&#39;utilisateur connecte&nbsp;<span style=\"color:#8b4513\"><strong>&lt;no_value&gt;</strong></span>.</p>\n', '<p>Je saisis <span style=\"color:#8B4513\"><strong>rakhimchaimaa@outlook.com</strong></span> dans le champ &quot;<strong>Adresse email</strong>&quot; et <span style=\"color:#8B4513\"><strong>openinnov9v1</strong></span> dans le champ &quot;<strong>Mot de passe</strong>&quot; et je clique sur le bouton &quot;<strong>Se connecter</strong>&quot;.</p>', 'READY', NULL, NULL, NULL, 88, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8118, 7677),
(6817, '<p>Je suis redirig&eacute; vers l\'url <span style=\"color:#8B4513\"><strong>&lt;no_value&gt;</strong></span>.</p>', '<p>Je clique sur &quot;Challenge&quot; dans le menu de navigation.</p>', 'READY', NULL, NULL, NULL, 130, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8119, 7678),
(6818, '<p>Le bloc <span style=\"color:#8B4513\"><strong>&lt;no_value&gt;</strong></span> est affich&eacute;.</p>', '<p>je v&eacute;rifie l\'affichage du bloc &quot;Challenges pass&eacute;s&quot;.</p>', 'READY', NULL, NULL, NULL, 131, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8120, 7679),
(6819, '<p>Je suis redirig&eacute; vers <span style=\"color:#8B4513\"><strong>&lt;no_value&gt;</strong></span></p>', '<p>Je clique sur le premier challenge dans le slider <span style=\"color:#8B4513\"><strong>&lt;no_value&gt;</strong></span>.</p>', 'READY', NULL, NULL, NULL, 132, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8121, 7680),
(6820, '<p>Les &eacute;l&eacute;ments list&eacute;s sont affich&eacute;s</p>', '<p>Je v&eacute;rifie l\'affichage des &eacute;l&eacute;ments suivants :&nbsp;</p> \n<ul> \n <li>Date</li> \n <li>Titre</li> \n <li>Tags</li> \n <li>Ic&ocirc;ne de partage</li> \n <li>Onglets Description</li> \n <li>Onglet Participants</li> \n</ul>', 'READY', NULL, NULL, NULL, 133, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8122, 7681),
(6821, '', '<p><span style=\"color:#FF0000\"><strong>Ajouter des pas de test (ou un cas de test) pour&nbsp;tester les outils de partage</strong></span></p>', 'READY', NULL, NULL, NULL, 134, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8123, 7682),
(6822, '<p>La galerie est affich&eacute;e.</p>', '<p>Je v&eacute;rifie l\'affichage de la galerie.</p>', 'READY', NULL, NULL, NULL, 135, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8124, 7683),
(6823, '<p>Le&nbsp;bloc &quot;Guidelines challenge&quot; est affich&eacute;.</p>', '<p>Je v&eacute;rifie l\'affichage du bloc &quot;Guidelines challenge&quot;.</p>', 'READY', NULL, NULL, NULL, 136, 'admin', '2018-09-26 15:33:06', NULL, NULL, 8125, 7684),
