INSERT INTO `resource` (`RES_ID`, `NAME`, `DESCRIPTION`, `CREATED_BY`, `CREATED_ON`, `LAST_MODIFIED_BY`, `LAST_MODIFIED_ON`, `ATTACHMENT_LIST_ID`) VALUES
(1, 'login', '', 'admin', '2018-07-27 10:48:57', NULL, NULL, 83),
(2, 'F104 – Mon profil', '', 'admin', '2018-07-31 10:22:41', NULL, NULL, 136),
(3, 'RG1040', '<p>Le clic sur ce bouton affiche les notifications li&eacute;es au compte.</p> \n<p>Type de notification :</p> \n<ul> \n <li>Demande de validation de l’email (Message M1041)</li> \n <li>Demande de la saisie du num&eacute;ro de contact (Message M1042)</li> \n <li>R&eacute;ponse sur une demande (Message M1043)</li> \n</ul>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 137),
(4, 'RG1041', 'Le clic sur la notification de type &laquo; Validation de l’email &raquo; ouvre le pop-up de saisir de code validation re&ccedil;u par email.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 138),
(5, 'RG10410', 'La modification du num&eacute;ro de contact doit respecter les m&ecirc;mes r&egrave;gles de gestion de la modification de l’email.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 139),
(6, 'RG10411', 'Le clic sur cet ic&ocirc;ne ouvre la liste des num&eacute;ros de lignes du compte connect&eacute;. La ligne principale est coch&eacute;e par d&eacute;faut.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 140),
(7, 'RG10412', '<p>Si le client coche une autre ligne alors :</p> \n<ul> \n <li>Si cette ligne existe d&eacute;j&agrave; comme ligne principale d’un autre compte, l’application affiche le message M1046.</li> \n <li>Sinon, l’application marque le MDN choisi comme le MDN principale du compte.</li> \n</ul>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 141),
(8, 'RG10413', 'Le clic sur ce lien ouvre le pop-up de changement de mot de passe.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 142),
(9, 'RG10414', 'Le clic sur ce bouton ferme le pop-up sans aucune modification.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 143),
(10, 'RG10415', '<p>La saisie des trois champs est obligatoire.</p> \n<p>Si le client clique sur &laquo; Valider &raquo; sans avoir rempli cette condition, L’application affiche le message M1001 et le champ vide est signaler avec un contour rouge.</p>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 144),
(11, 'RG10416', 'Si le mot de passe actuel saisie est incorrect l’application affiche le message d’erreur M1047.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 145),
(12, 'RG10417', 'CF. RG1004, RG1005', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 146),
(13, 'RG10418', '<p>Si le client renseigne un MDP valide et clique sur le bouton &laquo; Terminer &raquo;, alors :</p> \n<ul> \n <li>Son nouveau mot de passe est enregistr&eacute; dans LDAP.</li> \n <li>Le pop-up se ferme.</li> \n</ul>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 147),
(14, 'RG10419', '<p>Le bloc Historique affiche les 6 derni&egrave;res transactions.</p> \n<p>Le clic sur le bouton &laquo; Plus de d&eacute;tails &raquo; ouvre l’IHMF11 – Historique des transactions.</p>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 148),
(15, 'RG1042', '<p>La saisie du code de validation est obligatoire.</p> \n<p>Si le client clique sur &laquo; Valider &raquo; sans avoir rempli cette condition, L’application affiche le message M1001 et le champ vide est signaler avec un contour rouge.</p> \n<p>L’utilisateur &agrave; la possibilit&eacute; de renvoyer le code de validation.</p>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 149),
(16, 'RG10420', 'Le clic sur ce champ ouvre le clavier calendrier.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 150),
(17, 'RG10421', '<p>Le clic sur &laquo; OK &raquo; lance la recherche selon les crit&egrave;res saisis.</p> \n<ul> \n <li>Si les deux champs sont vides alors l’application affiche tous les r&eacute;sultats.</li> \n <li>Si aucun r&eacute;sultat trouv&eacute; alors l’application affiche le message M1048.</li> \n <li>Sinon l’application affiche les r&eacute;sultats inclus entres mes deux dates saisies.</li> \n</ul>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 151),
(18, 'RG10422', 'Le clic sur la photo ouvre cette derni&egrave;re en plein &eacute;cran avec l’ic&ocirc;ne d’action &laquo; Modifier &raquo;.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 152),
(19, 'RG10423', '<p>Le clic sur l’ic&ocirc;ne &laquo; Modifier &raquo; ouvre le pop-up qui contient les actions suivant :</p> \n<ul> \n <li>Galerie : Le clic sur ce bouton ouvre la Galerie du t&eacute;l&eacute;phone, puis le client choisie une nouvelle photo de profil et valide,</li> \n <li>Appareil photo : Le clic sur ce bouton ouvre l’appareil photo du t&eacute;l&eacute;phone, puis le client se prend en photo et valide son choix.</li> \n <li>Supprimer cette photo : Le clic sur ce bouton afficher le pop-up message M1049. Si le client clique sur &laquo; Retirer &raquo;, alors l’application supprime la photo de profil, Si le client clique sur &laquo; Annuler &raquo;, alors il revient sur l’IHM mon profil.</li> \n</ul>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 153),
(20, 'RG10424', '<p>Le clic sur le bouton &laquo; Se d&eacute;connecter &raquo;, afficher le pop-up message M10410.</p> \n<p>Si le client clique sur &laquo; Oui &raquo;, alors l’application affiche l’IHMF04 – Authentification.</p> \n<p>Si le client clique sur &laquo; Non &raquo;, alors le client reste sur l’IHM courante.</p>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 154),
(21, 'RG1043', 'Si le client clique sur ce bouton, alors l’application g&eacute;n&egrave;re et envoie un nouveau code de validation &agrave; l’email de l’utilisateur.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 155),
(22, 'RG1044', 'Si le client renseigne un code valide, alors son email est marqu&eacute; comme valider et le pop-up de validation se ferme.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 156),
(23, 'RG1045', 'Le clic sur la notification de type &laquo; Saisie du num&eacute;ro de contact &raquo; ouvre l’&eacute;cran mon profil IHMF09.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 157),
(24, 'RG1046', 'Le clic sur la notification de type &laquo; Saisie du num&eacute;ro de contact &raquo; ouvre l’&eacute;cran de consultation de la demande en question =&gt; IHM &agrave; d&eacute;finir.', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 158),
(25, 'RG1047', '<p>Le clic sur cet ic&ocirc;ne :</p> \n<ul> \n <li>Affiche le champ en mode modification</li> \n <li>Le bouton devient une ic&ocirc;ne de validation</li> \n</ul>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 159),
(26, 'RG1048', '<p>La saisie de l’email est obligatoire.</p> \n<p>Si le client clique sur &laquo; Valider &raquo; sans avoir rempli cette condition, L’application affiche le message M1001 et le champ vide est signaler avec un contour rouge.</p>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 160),
(27, 'RG1049', '<p><span style=\"color:#FF0000\">Si le client renseigne un Email valide et clique sur l’ic&ocirc;ne &laquo; Valider &raquo; :</span></p> \n<ul> \n <li><span style=\"color:#FF0000\">Il re&ccedil;oit automatiquement sur sa ligne principale un SMS (M1044) contenant son code de validation.</span></li> \n <li><span style=\"color:#FF0000\">L’application affiche le pop-up de saisie du code de validation.</span></li> \n</ul> \n<p><span style=\"color:#FF0000\"><strong>Particularit&eacute; :</strong> Si l’utilisateur est connect&eacute; sur Android, alors le code de validation re&ccedil;u par SMS est saisi automatiquement dans le champ.</span></p> \n<p><span style=\"color:#FF0000\">En parall&egrave;le le message M1045 est affich&eacute; sur le pop-up.</span></p>', 'admin', '2017-11-29 00:00:00', 'admin', '2018-07-31 10:22:48', 161),
(28, 'F101 – Authentification', '', 'admin', '2018-08-16 10:27:18', NULL, NULL, 1078),
(29, 'RG1010', '<p> La saisie du Login/MDP est obligatoire. </p> \n<p> Si le client clique sur &laquo; Valider &raquo; sans avoir rempli cette condition, L’application affiche le message M1001 et le champ vide est signaler avec un contour rouge. </p>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1079),
(30, 'RG1011', 'Le mot de passe doit &ecirc;tre affich&eacute; en crypt&eacute; au fur et &agrave; mesure que les caract&egrave;res s’affichent.', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1080),
(31, 'RG1012', '<p>Si le client rentre un login/MDP non valide alors l’application affiche le message d’erreur M1010.</p>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1081),
(32, 'RG1013', '<p>Le compte doit &ecirc;tre bloqu&eacute; pendant Y minute apr&egrave;s X &eacute;checs successifs, L’utilisateur re&ccedil;oit dans ce cas le message M1011</p> \n<ul> \n <li>Y min et X tentatives seront param&eacute;trables au niveau de la politique de connexion sur le BO.</li> \n</ul>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1082),
(33, 'RG1014', '<p>Si le client coche &laquo; Se souvenir de moi &raquo;, &agrave; sa prochaine connexion, il sera redirig&eacute; directement vers l’IHMF05 – Accueil.</p> \n<p>Dans le cas o&ugrave; il d&eacute;coche &laquo; Se souvenir de moi &raquo;, &agrave; sa prochaine connexion l’application lui demande de saisir ces identifiants.</p>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1083),
(34, 'RG1015', '<p>Si le client renseigne un login/MDP valide puis clique sur le bouton &laquo; Se connecter &raquo;, alors :</p> \n<ul> \n <li>Si c’est un client ADSL/FTTH qui se connecte pour la premi&egrave;re fois, l’application affiche l’IHMF06 – Premi&egrave;re connexion ADSL/FTTH.</li> \n <li>Sinon, l’application affiche l’IHMF05 – Accueil (&agrave; d&eacute;finir selon l’espace d’accueil).</li> \n</ul>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1084),
(35, 'RG1016', '<p>Si le client clique sur &laquo; Mot de passe oubli&eacute; &raquo; alors l’application affiche <span style=\"color:#FF0000\">l’IHMFXX – Mot de passe oubli&eacute;</span>.</p>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1085),
(36, 'RG1017', '<p>La saisie du MDP/Confirmation du MDP/l’Email est obligatoire.</p> \n<p>Si le client clique sur &laquo; Valider &raquo; sans avoir rempli cette condition, L’application affiche le message M1001 et le champ vide est signaler avec un contour rouge.</p>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1086),
(37, 'RG1018', '<p>Apr&egrave;s l’authentification, l’utilisateur sera redirig&eacute; vers son espace en fonction de son profile <span style=\"color:#FF0000\">=&gt; &agrave; d&eacute;finir</span>.</p>', 'admin', '2017-11-28 00:00:00', 'admin', '2018-08-16 10:27:20', 1087),
(38, 'Authentification', '', 'admin', '2018-09-03 09:20:08', NULL, NULL, 1171),
(39, 'Se connecter', '<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\">2 possibilit&eacute;s : </span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\">-R&eacute;seaux Sociaux (Facebook, Twitter, LinkedIn, Google+)</span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\">- E-mail </span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\"><u><strong>Dans le cas des RS</strong></u> : Choisir le compte (Facebook, Twitter, LinkedIn, Google+) </span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\"><u><strong>Dans le cas de l’e-mail</strong></u> : Entrer l’adresse e-mail et le mot de passe.</span></p> \n<p>&nbsp;</p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:09', 1172),
(40, 'Challenges', '', 'admin', '2018-09-03 09:20:08', NULL, NULL, 1173),
(41, 'Eléments de la page des challenges', '<p><strong><span style=\"font-size:12px\">1&egrave;re page :</span></strong></p> \n<p><span style=\"font-size:12px\">- Section description de l’Open Innov&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Section challenge avec descriptif&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton participer au challenge qui renvoie vers la sous page &laquo; descriptif du challenge &raquo;.&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Section des exp&eacute;rimentations digitales pass&eacute;es&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton d&eacute;couvrir qui renvoie vers la page du challenge*&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Slider&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Contact et adresse de l’Open Lab.&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Acc&egrave;s Maps&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer</span></p> \n<p>&nbsp;</p> \n<p><strong><span style=\"font-size:12px\">2&egrave;me page (apr&egrave;s avoir cliquer sur d&eacute;couvrir dans la section challenge pass&eacute;s)&nbsp;</span></strong></p> \n<p><span style=\"font-size:12px\">- Descriptif de l’ancien challenge&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Le nom de l’&eacute;quipe gagnante avec descriptif et les liens de partage vers les RS&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Blocs des diff&eacute;rentes projets participants avec leur nom qui redirige vers leur page profil&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer</span></p> \n<p>&nbsp;</p> \n<p><strong><span style=\"font-size:12px\">3&egrave;me page (apr&egrave;s avoir cliquer sur le bouton participer)&nbsp;</span></strong></p> \n<p><u><span style=\"font-size:12px\">Une sous barre de navigation (Page1) : Description du challenge</span></u></p> \n<p><span style=\"font-size:12px\">- Le d&eacute;lai&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Descriptif du challenge&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton &laquo; Deposez votre projet* &raquo;</span></p> \n<p><span style=\"font-size:12px\">- *Apr&egrave;s avoir cliquer sur le bouton &laquo; d&eacute;posez votre projet &raquo;, une fenetre s’ouvre avec deux choix : &laquo; Rejoindre une &eacute;quipe* &raquo; ou bien &laquo; D&eacute;posez votre projet *&raquo;.&nbsp;</span></p> \n<p><span style=\"font-size:12px\"><strong>&nbsp; &nbsp;- Choix 1 </strong>: &laquo; Rejoindre un projet&raquo; un formulaire s’affiche pour remplire les informations(Type de profil,comp&eacute;tences,fonction, &eacute;tablissement /entreprise)ensuite le bouton &laquo; suivant &raquo; qui renvoie vers la sous barre de navigation &laquo; Projets participants** &raquo;.&nbsp;</span></p> \n<p><span style=\"font-size:12px\"><span style=\"font-size:12px\"><strong>&nbsp; &nbsp;- Choix 2</strong> : &laquo; D&eacute;posez votre projet &raquo; un formulaire &laquo; D&eacute;taillez votre projet &raquo; qui s’affiche avec (nom du projet, logo,descriptif, possibilt&eacute; d’envoyer des invitations a vos co-&eacute;quipier,un fichier joint et une vid&eacute;o de votre participation, et le profil recherch&eacute; dans le cas ou vous cherchez un nouveau membre.Ensuite un pop- up &laquo; votre projet est en cours de validation &raquo; avec bouton fermer qui renvoie vers la sous barre de navigation &laquo; Projets participants &raquo;.</span></span></p> \n<p><span style=\"font-size:12px\">- Vid&eacute;o&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Guideline statique dans le cas ou c’est un challengen de Open Innov&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Liens de partage vers les RS&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer</span></p> \n<p><u><span style=\"font-size:12px\">Une sous barre de navigation (Page2) :** Projets participants.&nbsp;</span></u></p> \n<p><span style=\"font-size:12px\">- Blocs d’&eacute;quipes cherchant d’autre membres avec un bouton &laquo; contacter *&raquo;&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Blocs des projets valid&eacute;s avec le bouton &laquo; J’aime &raquo; et le nombre de j’aime sur le projet&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton &laquo; D&eacute;posez votre projet &raquo; qui renvoie vers le formulaire &laquo; D&eacute;taillez votre projet &raquo;</span></p> \n<p>&nbsp;</p> \n<p><u><span style=\"font-size:12px\"> Une sous barre de navigation (Page3) : Mon projet.</span></u></p> \n<p><span style=\"font-size:12px\">- Section gestion des demandes : Les profils qui demandent &agrave; rejoindre les &eacute;quipes avec deux boutons accepter et ignorer.&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Section fiche de projet : descriptif du projet, modifiable, et un bouton t&eacute;l&eacute;charger.&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Section membres : Les profils des membres de l’&eacute;quipe avec la possibilit&eacute; de quitter l’&eacute;quipe et le membre manquant ou pas.&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton valider votre participation</span></p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:09', 1174),
(42, 'Participer', '<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:rgb(0, 0, 0)\">Participer : </span></span></span></p> \n<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:rgb(0, 0, 0)\">Connexion obligatoire au site, ensuite deux choix possible : </span></span></span></p> \n<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:rgb(0, 0, 0)\"><strong>Choix 1</strong> : Rejoindre un projet Formulaire </span></span></span></p> \n<ul> \n <li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:rgb(0, 0, 0)\">Type de profil, comp&eacute;tences, fonction, &eacute;tablissement/entreprise, exp&eacute;rience startup.</span></span></span></li> \n</ul> \n<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong><span style=\"color:rgb(0, 0, 0)\"> </span></strong><span style=\"color:rgb(0, 0, 0)\"><strong>Choix 2</strong> : D&eacute;posez un projet Formulaire </span></span></span></p> \n<ul> \n <li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:rgb(0, 0, 0)\">nom du projet, logo du projet, description du projet,membres de l’equipe(envoyez des invitations par e-mail), fichier descriptif joint (optionnel), vid&eacute;o de votre participation,votre motivation, et le profil recherch&eacute;(dans le cas ou vous cherchez un nouveau membre).</span></span></span></li> \n</ul>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:09', 1175),
(43, 'Création de compte', '', 'admin', '2018-09-03 09:20:09', NULL, NULL, 1176),
(44, 'S\'inscrire', '<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\">2 possibilit&eacute;s : </span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\">-R&eacute;seaux Sociaux (Facebook, Twitter, LinkedIn, Google+)</span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\">- E-mail </span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\"><u><strong>Dans le cas des RS</strong></u> : Le site r&eacute;cup&egrave;re automatiquement le nom, pr&eacute;nom, et adresse e-mail de la personne .Il valide ensuite son compte via son e-mail.</span></p> \n<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\"><u><strong>Dans le cas de l’inscription par e-mail</strong></u> : il doit remplir les champs du formulaire : nom, pr&eacute;nom, adresse e-mail, mot de passe, puis accepter les conditions d’utilisation et valider l’inscription via son e-mail.</span></p> \n<p>&nbsp;</p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:09', 1177),
(45, 'Evénements', '', 'admin', '2018-09-03 09:20:09', NULL, NULL, 1178),
(46, 'Eléments de la page des événements', '<p><strong><span style=\"font-size:12px\">1&egrave;re page :</span></strong></p> \n<p><span style=\"font-size:12px\">- Barre de navigation de trois rubriques&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Filtre par ville&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Agenda d’&eacute;v&eacute;nement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton d&eacute;couvrir avec redirection vers la page de l’&eacute;v&eacute;nement*&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton s’abonner gratuitement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Section &eacute;v&eacute;nements &agrave; venir&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Section &eacute;v&eacute;nements pass&eacute;s&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Slider&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Diff&eacute;rents groupe d’&eacute;v&eacute;nement avec leurs &eacute;ditions&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer</span></p> \n<p><strong><span style=\"font-size:12px\">2&egrave;me page (*Apr&egrave;s avoir cliqu&eacute; sur le bouton d&eacute;couvrir) :&nbsp;</span></strong></p> \n<p><span style=\"font-size:12px\">- Image de l’&eacute;v&eacute;nement avec le nombre de place</span></p> \n<p><span style=\"font-size:12px\">restante&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton participer &agrave; l’&eacute;v&eacute;nement qui renvoie vers un formulaire&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- D&eacute;scription de l’&eacute;v&eacute;nement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Programme&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Intervenant avec leur profil LinkedIn&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Date et heure&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Adresse avec acc&egrave;s Maps&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Des tags concernant les cat&eacute;gories de l’&eacute;v&egrave;nement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Liens de partage de l’&eacute;v&eacute;nement sur les RS&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer&nbsp;</span></p> \n<p><strong><span style=\"font-size:12px\">3&egrave;me page (Apr&egrave;s avoir cliqu&eacute; sur les &eacute;ditions) :</span></strong></p> \n<p><span style=\"font-size:12px\">- Description de l’&eacute;v&eacute;nement - Photos de l’&eacute;v&eacute;nement - Footer</span></p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:09', 1179),
(47, 'Participer', '<p><span style=\"color:rgb(0, 0, 0); font-family:times; font-size:12pt\">Participer : Connexion obligatoire au site, par la suite compl&eacute;ter les informations suivantes : genre, ville, t&eacute;l&eacute;phone, fonction, &eacute;tablissement /entreprise.</span></p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:10', 1180),
(48, 'Page d\'accueil', '', 'admin', '2018-09-03 09:20:09', NULL, NULL, 1181),
(49, 'Les éléments de la page d\'accueil', '<p><span style=\"font-size:12px\">- Logo&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Barre de navigation de trois rubriques&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton s’inscrire et se connecter&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Mon compte (acc&eacute;der au profil et modifier les informations)&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Notification (&eacute;v&eacute;nement, demande pour rejoindrel’&eacute;quipe, demande d’ajouts, membre qui quitte l’&eacute;quipe et validation de votre projet.)&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Slider</span></p> \n<p><strong><span style=\"font-size:12px\">Section &eacute;v&eacute;nements&nbsp;</span></strong></p> \n<p><span style=\"font-size:12px\">- Bloc d’&eacute;v&eacute;nement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton s’abonner gratuitement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton &laquo; lire la suite &raquo; qui redirige vers l’&eacute;v&eacute;nement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton redirection vers la rubrique &eacute;v&eacute;nement&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Un container du challenge Open Innov avec un CTA &laquo; appel &agrave; projet &raquo; qui redirige vers la rubrique Open Innov&nbsp;</span></p> \n<p><strong><span style=\"font-size:12px\">Section actualit&eacute;s&nbsp;</span></strong></p> \n<p><span style=\"font-size:12px\">- Bloc d’actualit&eacute;s&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Boutons &laquo; Lire la suite &raquo; qui redirige vers l’article&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bloc pour les communiquer de presse&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton &laquo; souscrire &raquo;&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton redirection vers la rubrique d’actualit&eacute;s</span></p> \n<p><strong><span style=\"font-size:12px\">Section &laquo; ils nous ont fait confiance &raquo;&nbsp;</span></strong></p> \n<p><span style=\"font-size:12px\">- Photo avec des t&eacute;moignages des anciens participants,intervenants...&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer (condition d’utilisation, contact, les liens vers les RS et a propos)</span></p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:10', 1182),
(50, 'Start-ups', '', 'admin', '2018-09-03 09:20:10', NULL, NULL, 1183),
(51, 'Déposer votre communiqué', '<p><em>D&eacute;poser votre communiqu&eacute; : Connexion obligatoire au site par la suite remplir les informations suivantes : Titre, introduire le texte (le communiqu&eacute; de presse) ; et rajouter les adresse url du site web, ainsi l’url de la page Facebook, Twitter et laisser le contact</em></p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:10', 1184),
(52, 'Les éléments de la page des start-ups', '<p><strong><span style=\"font-size:12px\">1&egrave;re page :</span></strong></p> \n<p><span style=\"font-size:12px\">- Barre de navigation de trois rubriques&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bloc pour les communiquer de presse&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton souscrire qui renvoie vers un formulaire&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bouton s’abonner gratuitement &agrave; la newsletter&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Barre de recherche d’actualit&eacute;s&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Filtre par cat&eacute;gorie&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bloc des articles les plus visualis&eacute;s&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Blocs des diff&eacute;rentes cat&eacute;gories d’articles qui renvoient vers l’article&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer</span></p> \n<p><strong><span style=\"font-size:12px\">2&egrave;me page :&nbsp;</span></strong></p> \n<p><span style=\"font-size:12px\">- Image et l’article&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Liens de partage vers les RS&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Bloc de suggestion d’article&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Publier un commentaire&nbsp;</span></p> \n<p><span style=\"font-size:12px\">- Footer</span></p>', 'admin', '2018-08-28 00:00:00', 'admin', '2018-09-03 09:20:10', 1185);
